import React from 'react';

function Header() {
	return (
		<div>
			Header
			<ul>
				<li>Главная</li>
				<li>Технология</li>
				<li>График полетов</li>
				<li>Гарантии</li>
				<li>О компании</li>
				<li>Контакты</li>
			</ul>
		</div>
	);
}

export default Header;
